%[text] **Ejercicio 13**
%[text] Mida en régimen permanente tanto la acción de control como la velocidad de la escalera,  subiendo y bajando en diferentes condiciones de carga de la escalera, para consignas de  ±1 m/s. Relacione los incrementos o decrementos de acción de control con el peso de las  personas presentes en la escalera.

%[text] **Ejercicio 14**
%[text] Extraiga cuantas reflexiones estime oportunas sobre el cumplimiento de los objetivos y  sobre la comparativa entre especificaciones de diseño y resultados teóricos, simulados y  reales.

%%
%[text] ## Fase 4
%[text] **Ejercicio 15**
%[text] Calcule la FdeT del regulador así como sus unidades, aplicando la teoría que corresponda y justificando adecuadamente la variante de PID elegida, el resultado debe presentarlo de la forma factorizada, polinomial y con potencias negativas en z. Presente la ecuación en diferencias del regulador. Obtenga las ganancias proporcional, integral y derivativa, así como los tiempos de acción integral y derivativa del PID (parámetros de sintonía).
clearvars -except Kg pg Ts aproximacion decimales;

G = tf(Kg, [1 -pg]);
retardo = tf(1, [1 0], Ts);
BoG = series(c2d(G, Ts), retardo)
[NumBoG, DenBoG] = tfdata(BoG, 'v');

% Especificaciones
ts = 1.12;
erpp = 0;

% Calculo diferencias de grados
grado_Den_BoG = length(DenBoG) - find(DenBoG ~= 0, 1, 'first');
grado_Num_BoG = length(NumBoG) - find(NumBoG ~= 0, 1, 'first');
dif_grados_G = grado_Den_BoG - grado_Num_BoG;
retardos = dif_grados_G - 1;

% Calculo de parámetros. Como no puede haber oscilación, el polo debe ser
% real y positivo
ts_prima = ts - retardos*Ts;
pm = exp(Ts * aproximacion / ts_prima);
km = (1-pm)*(1-erpp);

% Primer intento: Controlador I
baseControladorI = Ts/2 * tf([1 1], [1 -1], Ts);

figure
rlocus(baseControladorI * BoG)
hold on
plot(pm * [1 1], 0.1 * [1 -1], 'r:')
title("Lugar de raíces de controlador I")
xlim([-1 1])
ylim([-1 1])
% El valor pertenece al lugar de raíces, pero no sería dominante.

% Segundo intento: Controlador PI. Se coloca el cero para cancelar el polo
% de la planta
ceroPI = max(abs(pole(BoG)));
baseControladorPI = tf([1 -ceroPI], [1 -1], Ts);

figure
rlocus(minreal(baseControladorPI * BoG))
hold on
plot(pm * [1 1], 0.1 * [1 -1], 'r:')
title("Lugar de raíces de controlador PI")
xlim([-1 1])
ylim([-1 1])
hold off

% Es posible -> Obtener parámetros
[~, pX, kX] = zpkdata(minreal(baseControladorPI * BoG), 'v');
K = prod(abs(pm - pX))/kX; % Condición modular

F = K * baseControladorPI;
[NumF, ~] = tfdata(F, 'v'); q0 = NumF(1); q1 = NumF(2);

% q0 =  kp + ki*Ts/2
% q1 = -kp + ki*Ts/2
Ki = (q0 + q1)/Ts;
Kp = (q0 - q1)/2;

fprintf("Parámetros del PI: \n\tKp = %.0" + decimales + "f \n\tKi = %.0" + decimales + "f \n\tq0 = %.0" + decimales + "f\n\tq1 = %.0" + decimales + "f\n\nControlador:", Kp, Ki, q0, q1)
F
F = zpk(F)
%%
%[text] **Ejercicio 16**
%[text] Calcule la FdeT del sistema y obtenga el/los polo/s del sistema.
M = minreal(feedback(series(F, BoG), 1))
[Zm, Pm, ~] = zpkdata(M, 'v');
fprintf("Ceros del sistema: [ "); fprintf("%.0" + decimales + "f ", Zm); fprintf("]");
fprintf("Polos del sistema: [ "); fprintf("%.0" + decimales + "f ", Pm); fprintf("]");
figure
pzplot(M)
title("Polos y ceros del sistema")
%%
%[text] **Ejercicio 17**
%[text] Caracterice teóricamente, tanto en régimen transitorio como permanente, la salida del sistema ante entradas escalón de ±1 m/s
retardos = length(Pm) - 1;

ks = ceil(aproximacion/log(max(abs(Pm)))) + retardos;
ts = ks * Ts;

for entrada = [1 -1]
    c_inf = entrada * dcgain(M);

    fprintf("Caracterización ante escalón de %.02f m/s: \n\tc_inf = %.0" + decimales + "f m/s\n\tks = %d\n\tts = %.0" + decimales + "f s\n\terpp = %.0" + decimales + "f\n\n", entrada, c_inf, ks, ts, abs(entrada - c_inf))
end
%%
%[text] **Ejercicio 18**
%[text] Calcule en régimen permanente tanto la acción de control como la velocidad de la escalera subiendo y bajando en diferentes condiciones de carga de la escalera, para consignas de ±1 m/s. Relacione los incrementos o decrementos de acción de control con el peso de las personas presentes en la escalera.
entradas             = [1 -1];
perturbaciones       = [0 -0.1 -0.2];
perturbaciones_names = [" 0 personas", " 5 personas", "10 personas"];

M_r = M;
M_p = zpk(minreal(feedback(1, series(F, BoG))));
K0_ref = dcgain(M_r);
K0_pert= dcgain(M_p);
K0_g = dcgain(BoG);

% Cálculo de error y acción en régimen permanente para distintas perturbaciones

for i = 1:length(entradas)
    fprintf("\nPara escalón de %0.2fV:\n", entradas(i))
    for j = 1:length(perturbaciones)
        r = entradas(i);
        p = perturbaciones(j);

        c = K0_ref * r + K0_pert * p;
        e = r - c;
        a = (c - p) / K0_g;

        fprintf("\tCon %s:\tc_inf=%.0" + decimales + "f m/s\terpp=%.0" + decimales + "f\ta_inf=%.0" + decimales + "f\n", perturbaciones_names(j), c, abs(e), a);
    end
end



